import React from 'react'
import styled from 'styled-components'
import {Search, ArrowDropDown} from "@material-ui/icons"

const Navbar = () => {
    return (
        <Container>
            <WrapperEvent><Event>Super Deal! Free Shipping</Event></WrapperEvent>
            <Wrapper>
                <Left>
                    <Language>EN</Language>
                    <ArrowDropDown/>
                    <SearchContainer>
                        <Input/>
                        <Search></Search>
                    </SearchContainer>
                </Left>
                <Center>
                    <Logo></Logo>
                </Center>
                <Right>right</Right>
            </Wrapper>
        </Container>
    )
}

const Container = styled.div`
    height: 80px;
`
const WrapperEvent = styled.div`
    display:flex;
    justify-content: center;
    background-color: green;
    height: 30px;
    color: white;
`

const Event= styled.span`
    font-size: 18px;
    color: white;
    align-items: center;

`
const  Wrapper = styled.div`
    padding: 10px 20px;
    display: flex;
    justify-content: space-between;
    align-items: center;
`

const Left = styled.div`
    flex: 1;
    display: flex;
    align-items: center;
`
const Language = styled.span`
    font-size: 14px;
    cursor: pointer;
`
const SearchContainer = styled.div`
    border: 0.5px solid lightgray;
    display: flex;
    align-items: center;
    margin-left: 25px;
    padding: 5px;
`
const Input = styled.input`
    border:none;
    box-shadow: none;
    margin-right: 5px;
`
const Center = styled.div`
    flex: 1;
`
const Logo = styled.div`
    backgroud: '../../include/logo.jpeg';
`
const Right = styled.div`
    flex: 1;
`
export default Navbar
